class UserData {  UserData({      this.id,       this.name,       this.email,       this.phone,       this.jobTitle,       this.country,       this.role,       this.image,      this.status,      this.gender,      this.emailVerifiedAt,       this.createdAt,       this.updatedAt,       this.coins,      this.fcm_token,      this.company_name,      this.nick_name,  });  UserData.fromJson(dynamic json) {    id = json['id'];    name = json['name'];    email = json['email'];    phone = json['phone'];    jobTitle = json['job_title'];    country = json['country'];    role = json['role'];    image = json['image'];    status = json['status'];    gender = json['gender'];    emailVerifiedAt = json['email_verified_at'];    createdAt = json['created_at'];    updatedAt = json['updated_at'];    coins = json['coins'];    company_name = json['company_name'];    nick_name = json['nick_name'];    fcm_token = json['fcm_token'];  }  int? id;  String? name;  String? email;  String? phone;  String? status;  String? jobTitle;  String? country;  String? nick_name;  String? company_name;  String? role;  String? image;  String? fcm_token;  String? gender;  String? emailVerifiedAt;  String? createdAt;  String? updatedAt;  int? coins;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['id'] = id;    map['name'] = name;    map['status'] = status;    map['email'] = email;    map['phone'] = phone;    map['job_title'] = jobTitle;    map['country'] = country;    map['fcm_token'] = fcm_token;    map['role'] = role;    map['image'] = image;    map['gender'] = gender;    map['email_verified_at'] = emailVerifiedAt;    map['created_at'] = createdAt;    map['updated_at'] = updatedAt;    map['coins'] = coins;    map['company_name'] = company_name;    map['nick_name'] = nick_name;    return map;  }}